  width: 100%;
  height: 30px;
  left: 0px;
  top: 0px;
  background: #100E2D;

  display: inline-flex;
  justify-content: flex-end;
  align-items: center;
}

.subscribe {
  display: inline-flex;
  justify-content: flex-start;
  flex-basis: 28%;
}
.subscr_title {
  flex-basis: 21%;
