  width: 100%;
  height: 60px;
  left: 0px;
  top: 30px;
  background: #FFFFFF;

  box-shadow: 0px 3px 4px rgba(94, 99, 102, 0.15);

  display: inline-flex;
  justify-content: center;
  align-items: center;

}

.logo {

  flex-basis: 70%;
}
